import React from 'react';
import styles from './NavBar.module.css'

const NavBar = () => {
    console.log(styles);
    return (
        <nav className={styles.main-nav}>
            <a className={styles.logo-img}> 1111111111111</a>
                <div className={'navbar-text'}>
                NAVBAR WORKING!
                </div>
        </nav>
    );
};

export default NavBar;
